//--------------------------------------------------------------------------
// MODULE:	  una_wstrcmp
//
// ABSTRACT:	  UNICODE 比較関数
//
// FUNCTION:
//	  UNICODE のための比較関数
//
// RETURN:
//	  -1		第1引数が第2引数より小さい
//	  0			第1引数が第2引数と等しい
//	  1			第1引数が第2引数より大きい
//
// NOTE:
//	  UNICODE 文字列は、ヌルターミネート文字列であること。strcmp のUNICODE版
//
int una_wstrcmp(
	const unaCharT *uStr1,	/* ヌルターミネート UNICODE 文字列 */
	const unaCharT *uStr2	/* ヌルターミネート UNICODE 文字列 */
	)
{
	int i;

	/* unaCharT を順番に比較 */
	for ( i = 0 ;; i++ ){	/* forever */
		if ( uStr1[i] < uStr2[i] ){
			return -1;
		}
		else if ( uStr1[i] > uStr2[i] ){
			return 1;
		}
		else if ( uStr2[i] == 0 ){	/* uStr1[i] == uStr2[i] == 0 の時*/
			return 0;
		}
	}
}

//--------------------------------------------------------------------------
// MODULE:	  una_wstrncmp
//
// ABSTRACT:	  UNICODE 比較文字列長指定比較関数
//
// FUNCTION:
//	  UNICODE 文字列のための比較文字列長指定比較関数
//
// RETURN:
//	  -1		第1引数が第2引数より小さい
//	  0			第1引数が第2引数と等しい
//	  1			第1引数が第2引数より大きい
//
// NOTE:
//	  UNICODE 文字列は、ヌルターミネート文字列であること。strncmp のUNICODE版
//
int una_wstrncmp(
	const unaCharT *uStr1,	/* ヌルターミネート UNICODE 文字列 */
	const unaCharT *uStr2,	/* ヌルターミネート UNICODE 文字列 */
	int  n					/* 比較したい文字数 */
	)
{
	int i;					/* ループ変数 */
	int len1;				/* 文字数1 */
	int len2;				/* 文字数2 */
	int len;				/* 実際に比較する文字数 */

	len1 = una_wstrlen(uStr1);
	len2 = una_wstrlen(uStr2);

	/* len を設定する。n,len1,len2 の内最小のものがセットされる */
	len  = n;
	if (len > len1) {
		len = len1;
	}
	if (len > len2) {
		len = len2;
	}
		
	/* unaCharT を len 文字まで順番に比較 */
	for ( i = 0 ; i < len ; i++ ){
		if ( uStr1[i] < uStr2[i] ){
			return -1;
		}
		else if ( uStr1[i] > uStr2[i] ){
			return 1;
		}
	}

	/* 以下に来るのは len 文字比較して同じだった場合 */
	if (len != n) { /* 文字列がn文字より小さかった場合 */
		if (len1 > len2) {
			return 1;
		}
		else if  (len1 < len2) {
			return -1;
		}
	}

	return 0;
}

